import React from "react";

import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination, Scrollbar, A11y } from 'swiper';

import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';


export default () => {
  return (
  
      <div class="swiper swiper-initialized swiper-horizontal swiper-backface-hidden">
  <div class="swiper-wrapper" id="swiper-wrapper-73d4362d29724f8b" aria-live="polite">
    <div class="swiper-slide img-swiper swiper-slide-active" role="group" aria-label="1 / 4" style="width: 300px; margin-right: 50px;">

    <Swiper 
    modules={[Navigation, Pagination, Scrollbar, A11y]}
    spaceBetween={50}
    slidesPerView={1}
    navigation
    pagination={{ clickable: true }}
    scrollbar={{ draggable: true }}
    >
      <SwiperSlide className="img-swiper"> 
        <img src="/images/bonus.png" alt=""style={{width:"100"}} />
      </SwiperSlide>
      <SwiperSlide>
        <img src="/images/free.png" alt="" />
        </SwiperSlide>
      <SwiperSlide>
        <img src="/images/promo.png" alt="" />
        </SwiperSlide>
      <SwiperSlide>
        <img src="/images/roulette.png" alt="" />
        </SwiperSlide>
  
    </Swiper>
    </div>
    </div></div>
  );
};
